    var queryMatch = true;
    var npuMatch = true;
    var categoryMatch = true;
    var neighborhoodMatch = true;
    if (this.filters.text) {
      var name = item.get('name').toLowerCase();
      var description = item.get('description').toLowerCase();
      var query = this.filters.text.toLowerCase();
      queryMatch = name.indexOf(query) > -1 || description.indexOf(query) > -1;
    }
    if (this.filters.npu)
      npuMatch = _.contains(item.npus, this.filters.npu);
    if (this.filters.neighborhood)
      neighborhoodMatch = _.contains(item.neighborhoods, this.filters.neighborhood);
    if (this.filters.category)
      categoryMatch = item.category === this.filters.category;
